import './App.css';
import MainPage from "./Components/MainPage";
import {Route, Router, Routes} from "react-router-dom";

function App() {
  return (
    <Router>
        <Routes>
            <Route index element={<MainPage/>} />
        </Routes>
    </Router>
  );
}

export default App;
